  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Hawaiian and
  Pacific Islands National Wildlife Refuge Complex (including Baker, Hanalei, Howland,
  Huleia, James Campbell, Jarvis, Kakahaia, Kilauea Point, and Rose Atoll NWRs) outlines
  Refuge accomplishments during the 1976 calendar year. The report begins with an
  introduction to the Refuge and information about weather conditions, habitat conditions,
  land acquisition activities, and the system status. Construction, maintenance, and
  wildfires are also described. Habitat management is covered; croplands, grasslands,
  wetlands, forests, and wilderness areas are discussed. The wildlife section of the
  report discusses endangered species, threatened species, migratory birds, mammals,
  and non-migratory birds. Interpretation and recreation activities are outlined;
  topics include law enforcement. Field investigations, cooperative programs, and
  safety information are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
